var PPUA={init:function(){this.bodyShow(),this.loadNav(),this.loadFoot(),this.headerBG(),this.homepageMap()},loadNav:function(){$("#main-navigation").load("partials/navigation.html")},loadFoot:function(){$("#page-footer").load("partials/footer.html",function(){$('[data-toggle="tooltip"]').tooltip()})},homepageMap:function(){0<$("#homepage").length&&$("map").imageMapResize(),$(".map-region").hover(function(){var a=$(this).data("bg");$("#main-map").addClass(a)},function(){var a=$(this).data("bg");$("#main-map").removeClass(a)})},headerBG:function(){var a=$("#main-header").data("bg");$("#main-header").css("background-image","url(assets/images/"+a)},bodyShow:function(){$(window).on("load",function(){$("body#homepage").css("display","block")})}};$(document).ready(function(){PPUA.init(),$("body").scrollspy({target:"#sidebar-nav-region"})});